import React from 'react';
import './Actif.css';
import ReturnTitle from './Title';
import ActifBoX from './Box';
import REturnArroW from './Arrow';
import { useReactToPrint } from 'react-to-print';
import { FcPrint, FcDocument } from 'react-icons/fc';
import { Link } from 'react-router-dom';

// Return Main Actif 
export default function ReturnAcTif() {

 const componentRef = React.useRef();
 const handlePrint = useReactToPrint({
  content: () => componentRef.current,
  documentTitle: 'emp-data',
  onAfterPrint: () => window.console.log('print success')
 })

 return (
  <div className='wrp-main-actif-well'>

   <div ref={componentRef} style={{ height: window.innerHeight }} className='wrp-main-actif'>
    <ReturnTitle />
    <ActifBoX />
    <REturnArroW />

   </div>

   <div className='wrp-icon-folder-print'>
    <div style={{ cursor: 'pointer' }} onClick={handlePrint}><FcPrint size={'2em'} /></div>
    <Link style={{ textDecoration: 'none' }} to='/authorization'>
     <FcDocument size={'2em'} />
    </Link>
   </div>
  </div>
 );
};
